function App() {

  const [page,setPage] = useState('home') 

  function setP(value){
    setPage(value)
  }

  return (
    <div>
    <BrowserView>
    {page==='home'?<Homepage onClick={setP}/>:<Profile val={page} onClick={setP}/>}
    </BrowserView>
    <MobileView>
    no
    </MobileView>
    </div>
  );
}

export default App;
